/*
Chat component for the chat application
*/
import "./chat.css";

function Chat(props) {
  const { username, country } = props;
  return (
    <div>
      <div class="container">
        <div class="users-list">
          <h2>User List</h2>
        </div>
        <div class="chat-messages">
          <h2>Chat Messages</h2>
        </div>
      </div>
      <div class="chat-input">
        <input type="text" placeholder="Type your message..." />
        <button>Send</button>
      </div>
    </div>
  );
}

export { Chat };
